import React from "react";
import Signup from "../userAccount/signUp/signUp";
import Login from "../userAccount/login/login";
import Profile from "../userAccount/Profile/profile";
import EditProfile from "../userAccount/editProfile/editProfile";

function home() {
  return (
    <div>
      {/*This is used to import the signUp page*/}
      <Signup />

      {/*This is used to import the login page*/}
      <Login />

      {/*This is used to import the profile page*/}
      <Profile />

      {/*This is used to import the editProfile page*/}
      <EditProfile />
    </div>
  );
}

export default home;
